import React from 'react';

const TweetUserInfoList = ({user}) => ( 
    <div className="grid-container2">
        {user.map((thisuser, key) => (
            <>
            <div key ={key}>
                <p>{thisuser.name}</p>
                <p>{thisuser.screen_name}</p>
            </div>
            </>
        ))}
    </div> 
)

export default TweetUserInfoList;
